import React from "react";
import styled from "styled-components";
import AddIcon from "@mui/icons-material/Add";
const Button = styled.button`
  padding: 20px;
  border-radius: 15px;
  background-color: rgba(249, 249, 249, 0.2);
  z-index: 12;
  position: absolute;
  left: 0;
  bottom: 0;
  cursor: pointer;
  border: none;
`;

const Image = styled.img``;

const Plus = () => {
  return (
    <Button>
      <AddIcon />
    </Button>
  );
};

export default Plus;
